ALIENFILE4_00:
; 1928 byte (482L). Loads from a1data4.bin, a2data4.bin, etc
; First four bytes appear to be a ptr. In all files it is 0768
; but by default it is 0x20a64 (ALIENFILE4_31)
; Next 30 bytes are 14 words and 2 bytes which are saved in save game file
; Useful script for alien comparison (e.g. read second lines):
; for n in *.bin; do xxd $n | head -2 | tail -1; done
;
; TODO: compare bytes from each alien file and record them here, e.g.:
; for n in *.bin; do ls $n; cat a1data4.bin | head -c434 | tail -c400 | xxd -c10 | cut -c10-33 | sed s/^/\;\ / ;done
; 
	DC.L	ALIENFILE4_31		;202fc: 00020a64
SAVEDATA1_ALIEN: ; alien number
	DC.W	$0001			;20300
SAVEDATA1_ALIEN_01: ; read-only. varies between aliens
	DC.W	$003c			;20302
SAVEDATA1_ALIEN_02: ; can increment. always starts zero
	DS.W	1			;20304
SAVEDATA1_ALIEN_03: ; read-only. varies between alien
	DC.W	$0046			;20306
SAVEDATA1_ALIEN_04: ; read-only. varies between alien
	DC.W	$00c8			;20308
SAVEDATA1_ALIEN_05: ; read-only. varies between alien
	DC.W	$0019			;2030a
SAVEDATA1_ALIEN_06: ; read-only, varies between alien
	DC.W	$0014			;2030c
SAVEDATA1_ALIEN_07: ; can be set to 100, decremented, compared to 140
; starts at 0 for all aliens except #2 (starts 140) and #5 (starts at 100)
	DS.W	1			;2030e
SAVEDATA1_ALIEN_08: ; can be set to 80 or decremented
; starts at 0 for all aliens except #5 (starts 100)
	DS.W	1			;20310
CANNON_05_DAMAGE: ; read-only. higher for later aliens
; How much damage this alien's hardpoint #5 deals
	DC.W	$0002			;20312
CANNON_07_DAMAGE: ; read-only. higher for later aliens.
	DC.W	$0004			;20314
